import React from 'react';

const AboutSection = () => {
    return (
        <section id="about">
            <h2>About Us</h2>
            <p>
                We are dedicated to providing the best service possible. Our team is committed to excellence and innovation.
            </p>
            <p>
                Our mission is to make a positive impact in our community and beyond. We believe in the power of collaboration and strive to create meaningful connections.
            </p>
        </section>
    );
};

export default AboutSection;
